import React from "react";
import { Link, Outlet } from "react-router-dom";
import Nav from "./Nav";
function Sucess() {
  return (
    <>
      <Nav />
      <h3 class="success-page">Your Tickets are booked successfully</h3>
      <div class="success-feedback">
        <p>Write your feed back here</p>
        <Link to="feedback">
          <button class="btn btn-primary w-10 py-2">Enter</button>
        </Link>
      </div>
      <Outlet />
    </>
  );
}
export default Sucess;
